import React, { useState } from 'react';
const [title, setTitle] = useState('');


function PostCreate() {

    return (
        <form className="formGroup" onSubmit={this.onSubmit}>
            <label>Title</label>
            <input type="text" />
            <button className="btn btn-primary" onClick={e => setTitle(e.target.value)}>Submit</button>
        </form>
    );
}

export default PostCreate;
